export default function getOpenTransactionBalance(transactions, transaction) {
  console.log(transaction);
  return (
    transaction.amt -
    transactions
      .filter(t => {
        return !!t.frm[transaction.sig];
      })
      .map(t => t.amount)
      .reduce((total, x) => {
        console.log(total, x, total + x);
        return total + x;
      }, 0)
  );
}
